import React from 'react';

const TaskCard = props => {
  let completion;
  if(props.tasks.complete){
      completion = "Complete";
  }
  else{
      completion = "Incomplete";
  }
  return (

      <tr>
        <td>
          {props.tasks.task}
        </td>
        <td>
          {completion}
        </td>
        <td>
          {props.tasks.date}
        </td>
      </tr>
  )
}

export default TaskCard;
